import SortableTable from "../components/SortableTable";
// import Table from "../components/Table";

function TablePage() {

  const data = [
    { name: 'LeBron James', teamColor: 'bg-red-800', pts75: 27, reb75: 7, ast75: 7, stk75: 2.5 },
    { name: 'Michael Jordan', teamColor: 'bg-red-500', pts75: 32, reb75: 6, ast75: 6, stk75: 3.0},
    { name: 'Kareem Abdul-Jabbar', teamColor: 'bg-green-500', pts75: 25, reb75: 12, ast75: 4, stk75: 3.0 },
    { name: 'Wilt Chamberlain', teamColor: 'bg-blue-500', pts75: 24, reb75: 22, ast75: 8, stk75: 8.0 },
    { name: 'Steph Curry', teamColor: 'bg-yellow-500', pts75: 2.5, reb75: 7, ast75: 7, stk75: 2.5 },
    { name: 'Kevin Garnett', teamColor: 'bg-blue-800', pts75: 4.25, reb75: 7, ast75: 7, stk75: 2.5 },
  ];

  const config = [
    { 
      label: 'Name',
      render: (fruit) => fruit.name,
      sortValue: (fruit) => fruit.name,
    },
    { 
      label: 'Color',
      render: (fruit) => <div className={`p-3 m-2 ${fruit.color}`}></div>,
    },
    { 
      label: 'Score',
      render: (fruit) => fruit.score,
      sortValue: (fruit) => fruit.score,
    },
    { 
      label: 'Score Squared',
      render: (fruit) => fruit.score ** 2,
      sortValue: (fruit) => fruit.score ** 2,
    },
    { 
      label: 'Half-Fruit',
      render: (fruit) => fruit.score / 2,
      sortValue: (fruit) => fruit.score / 2,
    },
  ];

  const keyFn = (player) => {
    return (
      player.name
    );
  };

  return (
    <div>
      <SortableTable config={config} data={data} keyFn={keyFn}/>
    </div>
  );
}

export default TablePage;
